package com.java.wrapperclassdemo;

public class ValueOfMethodDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		System.out.print("Passing string as parameter: ");
		Integer i1=Integer.valueOf("10");
		System.out.println(i1);
		System.out.print("Passing integer as parameter: ");
		Integer i2=Integer.valueOf(15);
		System.out.println(i2);
		System.out.print("Passing string as parameter: ");
		Double d1=Double.valueOf("10.5");
		System.out.println(d1);
		System.out.print("Passing string as parameter: ");
		Double d2=Double.valueOf(15.5);
		System.out.println(d2);
		
		
		
		

	}

}
